PropertySetProperty.Value:
def cal_pai_index():

 if ParameterValueByName("THw") == 1:
  THFactor=abs(Edge.AttributeValueByName( "MaxTH" )/2)
 elif ParameterValueByName("THw") == 2:
  THFactor=abs(Edge.AttributeValueByName( "MaxTH" )/4)
 elif ParameterValueByName("THw") == 3:
  THFactor=abs(Edge.AttributeValueByName( "MaxTH" )/6)
 elif ParameterValueByName("THw") ==4:
  THFactor=1

 if ParameterValueByName("CSw") == 1:
  CSFactor=abs(Edge.AttributeValueByName( "MaxCS" )/3)
 elif ParameterValueByName("CSw") == 2:
  CSFactor=abs(Edge.AttributeValueByName( "MaxCS" )/4)
 elif ParameterValueByName("CSw") == 3:
  CSFactor=abs(Edge.AttributeValueByName( "MaxTH" )/5)
 elif ParameterValueByName("CSw") ==4:
  CSFactor=1

 if ParameterValueByName("RSw") == 1:
  RSFactor=abs(Edge.AttributeValueByName( "MaxRS" )/3)
 elif ParameterValueByName("RSw") == 2:
  RSFactor=abs(Edge.AttributeValueByName( "MaxRS" )/5)
 elif ParameterValueByName("RSw") == 3:
  RSFactor=abs(Edge.AttributeValueByName( "MaxRS" )/6)
 elif ParameterValueByName("RSw") ==4:
  RSFactor=1

 if ParameterValueByName("ROw") == 1:
  ROFactor=abs(Edge.AttributeValueByName( "MaxRO" )/100)
 elif ParameterValueByName("ROw") == 2:
  ROFactor=abs(Edge.AttributeValueByName( "MaxRO" )/150)
 elif ParameterValueByName("ROw") == 3:
  ROFactor=abs(Edge.AttributeValueByName( "MaxRO" )/200)
 elif ParameterValueByName("ROw") ==4:
  ROFactor=1

 PAI=(THFactor + CSFactor + ROFactor + RSFactor)/4 * Edge.AttributeValueByName("Length")

 if PAI==0:
  return Edge.AttributeValueByName( "Length" )
 elif PAI>0:
  return PAI

